import VueResources from 'vue-resource'
import VueRouter from 'vue-router'
import Routes from './routes'
import { store } from './store/store';

Vue.use(VueResources);
Vue.use(VueRouter);

Vue.directive('search',{
  componentUpdated(el,binding){
    console.log(binding.arg)

  var high=el.innerHTML.replaceAll(binding.arg,`<span>${binding.arg}</span>`)
  //var ind = el.innerHTML.slice
  //el.querySelector('span').style.color="red"
  //targets.stu
        console.log(typeof high)
        el.append(high)



    //var arr=high.match(binding.arg)
    console.log(binding.arg)
    //el.style.color="red"
  }
})



const router = new VueRouter({
routes:Routes,
mode:'history' 
}); 


